        setUsers(response.data.rows[0].user_name)
      } catch(err) {
        console.error(err)
      }
    }

const ClickyButtonState = () => {
    const [buttonClicks, setButtonClicks] = useState(0)

    return (
        <div>
            <button onClick={() => setButtonClicks(buttonClicks + 1)}>
                State One
            </button>
            {buttonClicks}
        </div>
    )
}

const getUsers = () => {
    const [users, setUsers] = useState("");

    return (
        <div>
            <button onClick={() => setUsers(users)}>
                Get Users
